			console.log(root.background_mc.scaleX);
			if(root.character_mc.currentFrame == 20){
				root.character_mc.gotoAndPlay("walking");
			}
		
			if (event.keyCode == 39 && root.background_mc.x > -900) {
				root.character_mc.scaleX = 1.5
				root.background_mc.x = root.background_mc.x - speed;
			}
